import logo from './logo.svg';
import './App.css';
import Hauptseite from './pages/Hauptseite';
import Navbar from './components/navbar';
import Booknow from './components/booknow';
import Footer from './components/footer';

function App() {
  const x = <img src="https://sonnenhus.com/sonnenhusgross.jpg" alt="Sonnenhus" />;
  const y = <img src="https://sonnenhus.com/sonnenhusfotos2.jpg" alt="Sonnenhusalt" />;
  const images = [
    x,
    y
  ];

  return (
    <div className="App">
      <header>
        <Navbar/>
      </header>
      <div style={{padding:"10px"}}><Slideshow images={images} /></div>
      <div>
        <Hauptseite/>
        <Booknow/>
    </div>
    <footer>
      <Footer/>
    </footer>
    </div>
  );
}

export default App;
